import React, { useEffect, useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';






const App1 = () => {
    const [num, setNum] = useState(0);
    useEffect(() => {
        alert("i am clicked")
    })
    return (
        <>
          
            <button
                onClick={() => {
                    setNum(num + 1);
                }
                }
            >
                Click Me {num}
            </button>
             
      </>
    );
};
export default App1;
